import React from 'react';
import './Sidebar.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faPieChart, faCog, faFolder, faUsers, faSpinner, faBuilding, faChevronRight } from '@fortawesome/free-solid-svg-icons';

const Sidebar = () => {
  return (
    <div className="sidebar">
      <div className="sidebar-header">
        <img src="profile.jpg" alt="Profile Picture" />
        <span>Bruce Wayne</span>
      </div>
      <ul>
        <li>
        <FontAwesomeIcon icon={faChevronRight} className="arrow-icon" />
          <FontAwesomeIcon icon={faPieChart} /> Overview
          
        </li>
        <li>
          <FontAwesomeIcon icon={faBuilding} /> Organization
        </li>
        <li>
          <FontAwesomeIcon icon={faFolder} /> Projects
          <FontAwesomeIcon icon={faChevronRight} className="arrow-icon" />
        </li>
        <li>
          <FontAwesomeIcon icon={faUsers} /> People
          <FontAwesomeIcon icon={faChevronRight} className="arrow-icon" />
        </li>
        <ul className="nested-list">
          <span>Pages</span>
          <li>
            <FontAwesomeIcon icon={faSpinner} /> Example
            <FontAwesomeIcon icon={faChevronRight} className="arrow-icon" />
          </li>
          <li>
            <FontAwesomeIcon icon={faCog} /> Settings
            <FontAwesomeIcon icon={faChevronRight} className="arrow-icon" />
          </li>
          <li>
            <FontAwesomeIcon icon={faSpinner} /> Example
            <FontAwesomeIcon icon={faChevronRight} className="arrow-icon" />
          </li>
          <li>
            <FontAwesomeIcon icon={faSpinner} /> Example
            <FontAwesomeIcon icon={faChevronRight} className="arrow-icon" />
          </li>
        </ul>
      </ul>
    </div>
  );
};

export default Sidebar;
